interface Props {
    categories: HelpCategoryMap;
    currentPage: HelpPage;
    dispatch: any;

    page: AdminHelpContent;
}

interface State {
    disabled: boolean;
    currentCategory: string;
    currentTitle: string;
    currentContent: Map<orderId, ContentRow>;
    unsaved: boolean;
    isMedia: boolean;
    media: string;
}

export class AdminHelp extends React.Component<Props, State> {
    private className = "admin-help"

    constructor(props: Props) {
        super(props);
        
        this.state = {
            disabled: false,
            currentCategory: this.props.page.category,
            currentTitle: this.props.page.title,
            currentContent: this.loadContentMap(this.props.page.content),
            unsaved: false,
            
            isMedia: false,
            media: ''
        }
    }

    public render() {
        const c = this.className;
        const { dispatch } = this.props;
        const { currentCategory, currentTitle, disabled, unsaved } = this.state;
        const arrowMove = disabled ? {marginLeft: "-30%", transition: "3s", transitionTimingFunction: "ease-in-out"} : {};

        const contentRows = [...this.state.currentContent.values()];
        const sortedContentRows = contentRows.sort((a, b) => (a.orderId > b.orderId) ? 1 : -1);

        return (
            <div className={c}>
                <Row className={`${c}-buttons`}>
                    <Col>
                        <IoIosArrowRoundBack
                            className={`${c}-back-arrow`}
                            style={arrowMove}
                            onClick={this.handleContentGoBackClick}>

                            {/* TODO: on hover, show text below */}
                            {/* <span className={`${c}-back-arrow-text`}>
                                Go back
                            </span> */}
                        </IoIosArrowRoundBack>
                    </Col>

                    <Col>
                        <Button className={`${c}-edit-button`} color="secondary" disabled={!disabled} onClick={this.handleUndoChanges}>
                            Undo Changes
                        </Button>

                        <Button className={`${c}-edit-button`} color="success" disabled={!disabled} onClick={this.handleSaveChanges}>
                            Save
                        </Button>

                        <Button className={`${c}-edit-button`} color="danger" disabled={disabled} onClick={this.handleDeleteContent}>
                            Delete
                        </Button>
                    </Col>
                </Row>

                {/* <ReactMarkdown className={`${c}-content-title`} children={category} /> */}
                {/* <ReactMarkdown className={`${c}-content-title`} children={currentPage.title} /> */}

                <div className={`${c}-content-text`}>
                {/* {this.getTitleAndCategory()} */}
                <TextEditor
                // talk to NIC: showing the unsaved button when changes happen
                    text={currentTitle}
                    textHandler={this.handleTitleChange}
                    unsaved={unsaved}
                />

                <TextEditor
                    category={true}
                    text={currentCategory}
                    textHandler={this.handleCategoryChange}
                    unsaved={unsaved}
                />

                {sortedContentRows.map((cr,i) =>
                // cr.textContent &&
                    // <div key={i} className={`${c}-content-text`}>
                        <ContentRowEditor
                            key={i}
                            contentRow={cr}
                            dispatch={dispatch}

                            category={currentCategory}
                            title={currentTitle}
                            contentHandler={this.handleContentChange}
                            newSectionHandler={this.handleNewSection}

                            im={this.state.media}
                        />
                    // </div>
                )}

                {this.state.isMedia &&
                    <Modal isOpen={true} keyboard={true}>
                        <ModalHeader>Add Media Files</ModalHeader>
                        <ModalBody>
                            <Input type="file" accept="image/*" onChange={this.handleMedia} />
                        </ModalBody>
                    </Modal>
                }
                </div>
            </div>
        );
    };

    // https://www.positronx.io/understand-html5-filereader-api-to-upload-image-and-text-files/
    private handleMedia = (e: React.ChangeEvent<HTMLInputElement>) => {
        const image = e.currentTarget.files!.item(0)!;
        
        // console.log(image.name); save this name for imageId

        const reader = new FileReader();

        reader.readAsDataURL(image);

        // ASK NIC:
        // 1. Why is it that i have to do readAsDataURL and then onload vs. reader.result?
        // 2. Why is it that 'function(){}' can't call this.setState but '= () =>' can?
        reader.onload = () => {
            const imageString = reader.result!.toString();
            console.log(imageString)
            this.setState({ media: imageString });
        };
        // this.handleImageSection();
        this.setState({ isMedia: false });
    };

    private handleImageSection = (contentRow: ContentRow, above: boolean) => {
        const { dispatch } = this.props;
        const content = [...this.state.currentContent.values()];
        const temp = new Map<orderId, ContentRow>();
        const newOrderId = above ? contentRow.orderId : contentRow.orderId + 1;

        const con = Object.assign({}, {
            pageId: contentRow.pageId,
            orderId: newOrderId,
            type: 'string',
            textContent: 'NEW SECTION',
            // right now its contentRow.imageContent, but need to send in empty value, but makes it null somehow and api fails.
            imageContent: contentRow.imageContent,
            imageId: ''
        }) as ContentRow;

    };

    private loadContentMap = (content: ContentRow[]): Map<orderId, ContentRow> => {
        const contentMap = new Map<orderId, ContentRow>();
        content.map(c => contentMap.set(c.orderId, c));
        
        return contentMap;
    };

    private handleTitleChange = (text: string) => {
        this.setState({ disabled: true, currentTitle: text, unsaved: true});
    };

    private handleCategoryChange = (text: string) => {
        this.setState({ disabled: true, currentCategory: text, unsaved: true});
    };

    private handleContentChange = (val: string, orderId: number) => {
        const { currentContent } = this.state;
        const k = currentContent.get(orderId);

        if (val) {
            const v = Object.assign({}, k, { textContent: val }) as ContentRow;
            currentContent.set(orderId, v);
        } else {
            currentContent.delete(orderId);
        }
        
        this.setState({ disabled: true, unsaved: true });
    };

    private handleUndoChanges = () => {
        this.setState({
            currentCategory: this.props.page.category,
            currentTitle: this.props.page.title,
            currentContent: this.loadContentMap(this.props.page.content),
            disabled: false,
            unsaved: false
        })
    };

    private handleSaveChanges = () => {
        const { dispatch } = this.props;
        const { currentCategory, currentTitle, currentContent } = this.state;
        const updateContent: UpdateHelpPageContent[] = [];

        [...currentContent.values()].map(c => {
            const updatedContent = {
                title: currentTitle,
                category: currentCategory,
                pageId: c.pageId,
                orderId: c.orderId,
                type: c.type,
                textContent: c.textContent,
                imageContent: c.imageContent,
                imageId: c.imageId
            } as UpdateHelpPageContentDTO;
            updateContent.push(updatedContent);
        });

        dispatch(updateAdminHelpPageContent(updateContent));
        this.setState({ disabled: false, unsaved: false });
    };

    private handleContentGoBackClick = () => {
        const { dispatch } = this.props;
        const { unsaved } = this.state;
        dispatch(checkIfAdminHelpContentUnsaved(unsaved));
    };

    private handleDeleteContent = () => {
        const { dispatch, currentPage } = this.props;
        const { currentTitle } = this.state;

        const confirm: ConfirmationModalState = {
            body: `Are you sure you want to delete the page, "${currentTitle}"? This will take effect immediately and can't be undone.`,
            header: 'Delete Page',
            onClickNo: () => null,
            onClickYes: () => { dispatch(deleteHelpPageAndContent(currentPage)) },
            show: true,
            noButtonText: `No`,
            yesButtonText: `Yes, Delete Page`
        };
        dispatch(showConfirmationModal(confirm));
    };

    // new section logic
    private handleNewSection = (contentRow: ContentRow, above: boolean) => {
        const { dispatch } = this.props;
        const content = [...this.state.currentContent.values()];
        const temp = new Map<orderId, ContentRow>();
        const newOrderId = above ? contentRow.orderId : contentRow.orderId + 1;

        // const con = Object.assign({}, {
        //     pageId: contentRow.pageId,
        //     orderId: newOrderId,
        //     type: 'string',
        //     textContent: 'NEW SECTION',
        //     // right now its contentRow.imageContent, but need to send in empty value, but makes it null somehow and api fails.
        //     imageContent: contentRow.imageContent,
        //     imageId: ''
        // }) as ContentRow;
        const im = 'data:image/jpeg;base64,'
        const con = Object.assign({}, {
            pageId: contentRow.pageId,
            orderId: newOrderId,
            type: 'string',
            textContent: 'NEW SECTION',
            // right now its contentRow.imageContent, but need to send in empty value, but makes it null somehow and api fails.
            imageContent: im,
            imageId: ''
        }) as ContentRow;

        // "No" button is for adding media (images, gifs).
        // "Yes" button is for adding new text sections.
        const confirm: ConfirmationModalState = {
            body: 'Do you want to add a media file or a text section?',
            header: 'Select Media or Text',
            onClickNo: () => { this.setState({ isMedia: true }) },
            // onClickNo: () => {
            //     <Modal isOpen={true} keyboard={true}>
            //             <ModalHeader>Add Media Files</ModalHeader>
            //             <ModalBody>
            //                 <Input type="file" accept="image/*" onChange={this.handleMedia} />
            //             </ModalBody>
            //         </Modal>
            // },
            onClickYes: () => {
                content.forEach(c => {
                    if (c.orderId >= newOrderId) { c.orderId = c.orderId + 1 };
                });
                content.push(con);
                content.map(c => temp.set(c.orderId, c));
                this.setState({ currentContent: temp, disabled: true, unsaved: true });
            },
            show: true,
            noButtonText: 'Media',
            yesButtonText: 'Text',
        };
        dispatch(showConfirmationModal(confirm));
    };


    // private newSection = (contentRow: ContentRow, content: ContentRow[], above: boolean): ContentRow[] => {
    //     const t = above ? contentRow.orderId : contentRow.orderId + 1;
        
    //     const con = Object.assign({}, {
    //         pageId: contentRow.pageId,
    //         orderId: t,
    //         type: 'string',
    //         textContent: 'New Section',
    //         imageContent: new Uint16Array(),
    //         imageId: ''
    //     }) as ContentRow;

    //     content.forEach(c => {
    //         if(c.orderId >= t) {
    //             c.orderId = c.orderId + 1
    //         };
    //     });
    //     content.push(con);

    //     return content;
    // };
}